window.bookSummaryJSON = "<p><i>Barsoom Series Collection: 7 John Carter Stories</i> is an audiobook collection of seven novels/stories of John Carter by Edgar Rice Burroughs. It will transport you to a fascinating new world unlike any other. Join John Carter as he finds himself on another planet beyond his deepest imagination - Mars, with almost a complete lack of resources. </p> <p>Edgar Rice Burroughs' writings are inspired by a number of science-fiction writers and even some scientists who were dedicated to learning more about extraterrestrial life and ventures in space exploration. This infamous, well-written piece of literature by Burroughs has also been adapted by a number of writers in short stories, novels, films, and comics. Enjoy these must-hear novels in a beautifully narrated audiobook. It includes: </p> <p>1. <i>A Princess of Mars</i> 2. <i>The Gods of Mars</i> 3. <i>The Warlord of Mars</i> 4. <i>Thuvia, Maid of Mars</i> 5. <i>The Chessmen of Mars</i> 6. <i>The Master Mind of Mars</i> 7. <i>Yellow Men of Mars</i> </p> <p>Follow John Carter as he travels through the desolate landscape of Mars. Experience adventures full of feats of daring and dazzling swordplay! </p>"; 
